import React from 'react';
import {Link ,Route, Switch}  from 'react-router-dom';
import Cart from '../Cart/Cart';
import Cold from '../Cold/Cold';
import Home from '../Home/Home';
import Hot from '../Hot/Hot';
import HotDescription from "../Description/HotDescription";
import ColdDescription from "../Description/ColdDescription";
import  Navbar from 'react-bootstrap/Navbar';
import { Nav} from 'react-bootstrap';
import { Container} from 'react-bootstrap';
import {Offcanvas} from 'react-bootstrap'

function Header () {
    return (
<>
     <Navbar bg="light" expand={md}>
  <Container fluid>
    <Link to ='/'><h1>Czhring</h1></Link>
    <Navbar.Toggle aria-controls="offcanvasNavbar" />
    <Navbar.Offcanvas
      id="offcanvasNavbar"
      aria-labelledby="offcanvasNavbarLabel"
      placement="end"
    >
      <Offcanvas.Header closeButton>
        <Offcanvas.Title >Czhring' coffee</Offcanvas.Title>
      </Offcanvas.Header>
      <Offcanvas.Body>
        <Nav className="justify-content-end flex-grow-1 pe-3">
            <Link to ='/hot'>Hot</Link >
            <Link to ='/iced'>Cold</Link >
            <Link to ='/cart'>My Cart</Link>
        </Nav>
      </Offcanvas.Body>
    </Navbar.Offcanvas>
  </Container>
</Navbar>
</>
)
}


export default Header
